import React from "react";
import "./App.css";

class Tile extends React.Component {
    constructor(props) {
        super(props);
        this.state = {value: 0};
      }
  render() {
    return (
      <div class="two-tile">
        <h1>2</h1>
      </div>
    );
  }
}

export default Tile;
